(function(){var loadHandler=window['sl_{F1D6AFFC-D157-4E00-A574-51F982076741}'];loadHandler&&loadHandler(7, '<div id="spr0_1099cf2c"><div id="spr1_1099cf2c" class="kern"><img id="img5_1099cf2c" src="data:image/png;base64," width="720px" height="540px" alt="" style="left:0px;top:0px;"/><div id="spr3_1099cf2c" style="left:-0.75px;top:-0.563px;"><img id="img0_1099cf2c" src="data:image/png;base64," width="721.5" height="82" alt=""/></div><div id="spr4_1099cf2c" style="left:345px;top:-0.563px;"><img id="img1_1099cf2c" src="data:image/png;base64," width="375" height="47.812" alt=""/></div><div id="spr5_1099cf2c" style="left:-2.751px;top:-1.714px;"><div id="spr6_1099cf2c" style="left:0.001px;top:34.523px;"><img id="img2_1099cf2c" src="data:image/png;base64," width="722.775" height="50.106" alt=""/></div><div id="spr7_1099cf2c" style="left:0.65px;top:40.368px;"><img id="img3_1099cf2c" src="data:image/png;base64," width="723.63" height="41.02" alt=""/></div></div></div><div id="spr2_1099cf2c" class="kern"><div id="spr8_1099cf2c" style="left:36px;top:55.44px;"><div style="width:0px;"><span id="txt0_1099cf2c" data-width="324.243164" style="top:23.675px;">Standing Waves</span></div></div><div id="spr9_1099cf2c" style="left:36px;top:152.4px;"><div style="width:0px;"><span id="txt1_1099cf2c" class="nokern relpos" style="left:7.2px;top:8.059px;"></span><span id="txt2_1099cf2c" class="relpos" data-width="565.208008" style="left:15.111px;top:4.182px;">Standing waves occur when two waves of the same</span></div><div style="width:0px;"><span id="txt3_1099cf2c" data-width="561.945313" style="left:28.8px;top:35.382px;">amplitude and frequency are travelling in opposite</span></div><div style="width:0px;"><span id="txt4_1099cf2c" data-width="562.948242" style="left:28.8px;top:66.582px;">directions in the same string. Usually one wave is a</span></div><div style="width:0px;"><span id="txt5_1099cf2c" data-width="112.175781" style="left:28.8px;top:97.782px;">reflection.</span></div><div style="width:0px;"><span id="txt6_1099cf2c" class="nokern relpos" style="left:7.2px;top:139.099px;"></span><span id="txt7_1099cf2c" class="relpos" data-width="612.650391" style="left:15.111px;top:135.222px;">*Note this does not mean that the string is stationary, it</span></div><div style="width:0px;"><span id="txt8_1099cf2c" data-width="239.852539" style="left:28.8px;top:166.422px;">continues to oscillate.</span></div></div><div id="spr10_1099cf2c" style="left:86.13px;top:297.025px;"><img id="img4_1099cf2c" src="data:image/png;base64," width="247" height="139" alt="" style="left:-0.001px;top:0.237px;"/></div><div id="spr11_1099cf2c" style="left:379.521px;top:304.796px;"><div style="width:0px;"><span id="txt9_1099cf2c" class="nokern relpos" data-width="9.136230" style="left:7.2px;top:3.835px;">a)</span><span id="txt10_1099cf2c" class="nokern relpos" data-width="210.061523" style="left:18.314px;top:3.835px;">At a particular point in time, the two waves are</span></div><div style="width:0px;"><span id="txt11_1099cf2c" class="nokern" data-width="229.205566" style="left:27.45px;top:16.435px;">completely superimposed, so that crest meets crest</span></div><div style="width:0px;"><span id="txt12_1099cf2c" class="nokern" data-width="231.922852" style="left:27.45px;top:29.035px;">and trough meets trough, to give the wave twice the</span></div><div style="width:0px;"><span id="txt13_1099cf2c" class="nokern" data-width="85.010010" style="left:27.45px;top:41.635px;">original amplitude.</span></div><div style="width:0px;"><span id="txt14_1099cf2c" class="nokern relpos" data-width="9.756592" style="left:7.2px;top:54.235px;">b)</span><span id="txt15_1099cf2c" class="nokern relpos" data-width="233.501953" style="left:17.693px;top:54.235px;">After a time equal to T/4 , the wave will have moved</span></div><div style="width:0px;"><span id="txt16_1099cf2c" class="nokern" data-width="237.403564" style="left:27.45px;top:66.835px;">¼ wavelength, which means that they have moved ½</span></div><div style="width:0px;"><span id="txt17_1099cf2c" class="nokern" data-width="238.346924" style="left:27.45px;top:79.435px;">a wavelength in relation to each other. The waves are</span></div><div style="width:0px;"><span id="txt18_1099cf2c" class="nokern" data-width="184.934326" style="left:27.45px;top:92.035px;">completely out of phase and the resulting</span></div><div style="width:0px;"><span id="txt19_1099cf2c" class="nokern" data-width="94.110352" style="left:27.45px;top:104.635px;">displacement is zero.</span></div></div></div></div>');})();